import React, {Component} from 'react';
import {MenuItem} from "./MenuItem";
import {NavLink} from "react-router-dom";
class Nav extends Component {
    render() {
        return (
            <div className='nav'>
                {MenuItem.map((item,index)=> {
                    return (

                            <NavLink  key={index} >
                                <li to={item.url}>
                                {item.title}
                                </li>
                            </NavLink>
                        )
                })}
            </div>
        );
    }
}

export default Nav;
